;; **
;;; ## Invert and blur picture
;; **

;; @@
(-> "resources/images/cat.jpg"
  imread
  clone
  (u/resize-by 0.2)
  (median-blur! 7)
  (cvt-color! COLOR_BGR2GRAY)
  bitwise-not!
  g/>>)
