;; **
;;; ## Find contours of headphones
;; **

;; @@
(def headphones (-> "resources/morph/headphone.png" imread))
(g/>> headphones)

;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"510\" height=\"316\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x66b13da4 \"BufferedImage@66b13da4: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@7d9bc538 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 510 height = 316 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; @@
(defn find-contours! [ mat ]
  (let[ contours (new-arraylist) ]
	(find-contours mat contours (new-mat) RETR_LIST CHAIN_APPROX_SIMPLE)
    contours))

(def headphones1 
  (clone headphones))

(-> headphones1 
    (clone)
    (cvt-color! COLOR_BGR2GRAY) 
    (find-contours!)
    ((fn[x] (doall (map #(rectangle headphones1 (bounding-rect %) rgb/blue-2 3) x)) headphones1))
    (g/>>))
;; @@
;; =>
;;; {"type":"html","content":"<img src=\"data:image/png;base64,\" width=\"510\" height=\"316\" alt=\"\" />","value":"#object[java.awt.image.BufferedImage 0x451abc48 \"BufferedImage@451abc48: type = 5 ColorModel: #pixelBits = 24 numComponents = 3 color space = java.awt.color.ICC_ColorSpace@7d9bc538 transparency = 1 has alpha = false isAlphaPre = false ByteInterleavedRaster: width = 510 height = 316 #numDataElements 3 dataOff[0] = 2\"]"}
;; <=

;; @@
(def headphones2 (clone headphones))

(doseq [c contours]
  (if (> (contour-area c) 100 )
    (let [ rect (bounding-rect c)]
      (if (> (.height rect) 28)
      (rectangle headphones2 rect rgb/blue-2 3)))))

(g/>> headphones2)
